import React from 'react';
import{ Link, Switch, Route } from 'react-router-dom';
import './components.css';
import Page from './MovePage.js'
import MechanicsGrid from './MechanicsGrid.js'


function MovesRoutes(props) {

  console.log(JSON.stringify(props));
  const root = props.match.path.split("/")[2]

  return (
    <Switch>
      <Route exact path={`/mechanics/${root}`} component={MechanicsGrid}/>
      <Route path={props.location.pathname} component={Page}/>
    </Switch>
  );

}

function Moves(props) {

  const moves = props.moves
  console.log(moves);
  console.log(JSON.stringify(props));


  MovesRoutes(props, moves);

  return (
    <div>
    {
      moves.map(move => (
          <button className="button" key={move}>
              <Link className="buttonLink" to={`/mechanics/time/${move}`}>{move}</Link>
          </button>
          ))
        }
    </div>
  )

}


export default Moves;
